/* traffic tracking script
  tracks from where players enter this parcel, and where they leave to
*/

// clear after sending. if not null on socket start we send this to the server
var start_packet = null;
// socket has been opened
var socket_started = false;
let socket = new WebSocket('wss://tachibana.cyberium.club/cryptovoxels');
socket.addEventListener('error', (event) => {
  socket_started = false;
});
socket.addEventListener('open', (event) => {
  if (start_packet) {
    socket.send(start_packet);
    start_packet = null;
  }
  socket_started = true;
});
socket.addEventListener('close', (event) => {
  socket_started = false;
});
parcel.addListener('playerenter', function(player) {
  // need to wait sometimes to make sure player position is not 0,0,0
	let func = function() {
    if (player && !player.position && player.player) {
      // fix for stupid issue that just started???
      player = player.player;
    }
    if (!player || !player.position || player.position.x == 0) {
      setTimeout(func, 60);
      return;
    }
    else {
      start_packet = JSON.stringify({
        method: 'player_enter',
        data: {
          parcel_id: parcel.id,
          player_name: player.name,
          player_wallet: player.wallet,
          position: {
            x: player.position.x,
            y: player.position.y,
            z: player.position.z
          },
          rotation: {
            x: player.rotation.x,
            y: player.rotation.y,
            z: player.rotation.z
          }
        }
      });
      if (socket_started && socket) {
        socket.send(start_packet);
        start_packet = null;
      }
    }
	}
  setTimeout(func, 10);
});
parcel.addListener('playerleave', function(player) {
  if (player && !player.position && player.player) {
    // fix for stupid issue that just started???
    player = player.player;
  }
  if (socket_started && socket && player && player.position) {

		let packet = JSON.stringify({
			method: 'player_leave',
			data: {
				parcel_id: parcel.id,
				player_name: player.name,
				player_wallet: player.wallet,
				position: {
					x: player.position.x,
					y: player.position.y,
					z: player.position.z
				},
				rotation: {
					x: player.rotation.x,
					y: player.rotation.y,
					z: player.rotation.z
				}
			}
		});
    socket.send(packet);
  }
});

