let ticker_texts_line = -1;
let repeats_per_line = 2;
let ticker_repeats_left = 0;
let ticker_text_uncropped = '';
let ticker_length = 32;
let tick_by_word = false;
let word_minimum_length = 6;

function main() {
	// don't continue until sign_json is assigned
	let sign_json = parcel.getFeatureById('sign-json');
	if (!sign_json) {
		console.log('ERROR: parcel.getFeatureById(\'sign-json\') is returning', sign_json, ' but it\'s there. ben please fix this :(');
		//setTimeout(main, 100);
		return;
	}

	let json_obj = {};
	try {
		json_obj = JSON.parse(sign_json._content.text);
	}
	catch(e) {
		console.log('Error', e);
	}
	console.log('LOADED INFO FROM PARCEL', json_obj);
	ticker_texts_line = json_obj.ticker_texts_line || -1;
	ticker_repeats_left = json_obj.ticker_repeats_left || 0;

	setInterval(() => {
		next_slideshow();
	}, 30000);

	let ticker_text_0 = parcel.getFeatureById('ticker-text-0');
	let ticker_text_1 = parcel.getFeatureById('ticker-text-1');
	let ticker_text_2 = parcel.getFeatureById('ticker-text-2');
	ticker_interval = tick_by_word == true ? 250*Math.max(1,word_minimum_length) : 250;
	setInterval(() => {
		let ticker_text = ticker_text_tick();
		let ticker_cropped = ticker_text.substring(ticker_length*0,ticker_length*1);
		ticker_text_0.set({
			text: ticker_cropped
		});
		ticker_text_1.set({
			text: ticker_cropped
		});
		ticker_text_2.set({
			text: ticker_cropped
		});
	}, ticker_interval);
	parcel.getFeatureById('next-button').on('click', () => next_slideshow());
	parcel.getFeatureById('back-button').on('click', () => last_slideshow());
}

function choice(choices) {
	let index = Math.floor(Math.random() * choices.length);
	return choices[index];
}

function ticker_text_tick() {
	if (tick_by_word) {
		// remove first word
		ticker_text_uncropped = ticker_text_uncropped.substring(word_minimum_length-1);
		ticker_text_uncropped = ticker_text_uncropped.substring(ticker_text_uncropped.indexOf(' ')+1);
	}
	else {
		// remove first letter
		ticker_text_uncropped = ticker_text_uncropped.substring(1);
	}
	while (ticker_text_uncropped.length < ticker_length*3) {
		ticker_repeats_left -= 1;
		if (ticker_repeats_left < 0) {
			ticker_texts_line = (ticker_texts_line+1) % ticker_texts.length;
			ticker_repeats_left = repeats_per_line;
		}
		let sign_json = parcel.getFeatureById('sign-json');
		sign_json.set({
			text: JSON.stringify({
				ticker_texts_line: ticker_texts_line,
				ticker_repeats_left: ticker_repeats_left
			})
		});
		ticker_text_uncropped += ticker_texts[ticker_texts_line] + ' ... ';
	}
	return ticker_text_uncropped;
}

function next_slideshow() {
	slideshow_pos = (slideshow_pos + 1) % slideshow_urls.length;
	update_slideshow();
}
function last_slideshow() {
	slideshow_pos = (slideshow_pos - 1) % slideshow_urls.length;
	if (slideshow_pos < 0) {
		slideshow_pos = slideshow_urls.length-1;
	}
	update_slideshow();
}
function update_slideshow() {
	let main_image = parcel.getFeatureById('main-image');
	let main_link = parcel.getFeatureById('main-link');
	let link = slideshow_urls[slideshow_pos];
	let new_image_url = link[0];
	let new_name = link[1];
	let new_url = link[2];
	main_image.set({
		url: new_image_url,
		link: new_url
	});
	main_link.set({
		text: new_name,
		link: '',
		fontSize: '81',
		scale: [4, 0.5, 0.5]
	});
}

function refreshImage(imageName, url) {
    let image = parcel.getFeatureById(imageName);
    if (image) {
		let old_url = image._content.url;
        let index = url.indexOf('?');
        let timestamp = (new Date).getTime();
        let new_url = (index > -1) ? url.substring(0, index)+'?'+timestamp : url+'?'+timestamp;
        image.set({
            url: new_url
        });
		let stretch = image._content.stretch;
		// set to old URL for a few seconds to give the image server time to load it
        image.set({
            url: old_url
        });
		setTimeout(function() {
			// refresh again because the image server is glitchy
			image.set({
				url: new_url,
				stretch: !stretch
			});
			setTimeout(function() {
				refreshImage(imageName, url);
			}, 60000);
		}, 3000);
    }
}
